/*Table structure for table `goods` */

DROP TABLE IF EXISTS `goods`;

CREATE TABLE `goods` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `good_name` varchar(40) DEFAULT NULL COMMENT '商品名称',
  `good_price` float(10,2) DEFAULT NULL COMMENT '商品单价',
  `good_phone` varchar(20) DEFAULT NULL COMMENT '商品联系电话',
  `good_address` varchar(40) DEFAULT NULL COMMENT '商品地址',
  `good_num` int(11) DEFAULT NULL COMMENT '商品库存',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

