/* Procedure structure for procedure `pro_addManyFoods` */

/*!50003 DROP PROCEDURE IF EXISTS  `pro_addManyFoods` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `pro_addManyFoods`()
begin
	declare i int default 0;
	declare price float(10,2) default 0;
	while i<=1000 do
		SELECT FLOOR(RAND()*100) into price;
		INSERT INTO foods(food_name,food_taste,food_price,food_description) 
		VALUES(concat('test',i),'1',price,'很好吃');
		set i=i+1;
	end while;
end */$$
DELIMITER ;

